package com.example.afinal.framents;

import static android.content.Intent.getIntent;

import android.content.Intent;
import android.net.Uri;
import android.os.Bundle;
import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;
import android.widget.Button;
import android.widget.ImageView;
import android.widget.TextView;

import androidx.fragment.app.Fragment;

import com.bumptech.glide.Glide;
import com.example.afinal.R;

public class userfragment extends Fragment {
    View view;
    TextView userName, userEmail, phoneNumber;
    String at;

    ImageView user_image;
    Button call_btn, mes_btn;

    @Override
    public View onCreateView(LayoutInflater inflater, ViewGroup container,
                             Bundle savedInstanceState) {
        // Inflate the layout for this fragment
        view = inflater.inflate(R.layout.activity_user_page, container, false);

        phoneNumber = view.findViewById(R.id.phoneNumber);
        userName = view.findViewById(R.id.userName);
        userEmail = view.findViewById(R.id.userEmail);
        user_image = view.findViewById(R.id.user_image);
        call_btn = view.findViewById(R.id.call_btn);
        mes_btn = view.findViewById(R.id.mes_btn);


        Intent intent = getActivity().getIntent();
        String uEmail = intent.getStringExtra("email");
        String uName = intent.getStringExtra("name");
        String uPass = intent.getStringExtra("password");

        userEmail.setText( uEmail);
        userName.setText( uName);

        Glide
                .with(this)
                .load("data:image/jpeg;base64,")
                .centerCrop()
                .placeholder(R.drawable.adam_icon)
                .into(user_image);


        call_btn.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                Intent intent = new Intent(Intent.ACTION_DIAL);
                intent.setData(Uri.parse("tel:" + phoneNumber.getText()));
                startActivity(intent);
            }
        });

        mes_btn.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                Uri uri = Uri.parse("smsto:" + phoneNumber.getText());
                Intent intent = new Intent(Intent.ACTION_SENDTO, uri);
                intent.putExtra("sms_body", "Hello you are welcome to project");
                startActivity(intent);
            }
        });



        return view;
    }


}